When using ClassTypeLoader to load an Interface Type with getter methods defined the resulting *MetadataType* contains inexistent 

For example having an Interface Animal life this one:
{code:java}
public interface Animal 
{
    String getSpeciesName();
}
{code}

The resulting MetadataType will contain a field named "speciesName"

