I have a parameter declared as 
{code:java}
    @Parameter
    @Optional(defaultValue = "AUTO")
    private Function<MuleEvent, HttpStreamingType> requestStreamingMode;
{code}
where HttpStreamingType is an Enum (AUTO, ALWAYS, NEVER).
