Caused by: org.mule.runtime.core.api.transformer.TransformerException: Could not find a transformer to transform "SimpleDataType{type=java.lang.String, mimeType='*/*', encoding='null'}" to "SimpleDataType{type=org.mule.extension.http.api.HttpStreamingType, mimeType='*/*', encoding='null'}".
