*QName with invalid character is generated when using an Inner Enum class as parameter*

When using a Enum Class as parameter of a Operation, the SDK generates a child element with the name of this class.
{code:title=SchemaBuilder.java}
 attribute.setType(new QName(schema.getTargetNamespace(), enumType.getName() + SchemaConstants.ENUM_TYPE_SUFFIX));
{code}
But the problem comes when this Enum Class, is a Inner Enum Class, so the full qualifier name of this type would be, for example: {{org.mule.module.http.api.HttpConstants$ProtocolsEnumType}}, which contains the {{$}} symbol, is an Invalid character for a QName.

*What to do?*
* Fix generation of Inner Enums, replacing or deleting invalid characters.

*Valid and Invalid characters:*
http://stackoverflow.com/questions/1631396/what-is-an-xsncname-type-and-when-should-it-be-used

