fromString:
Add the concept of an ExceptionHandler in the ext-api which gets invoked whenever an operation throws an exception. This is useful to avoid repetitive try..catch blocks.

It would be defined by an interface roughly looking like this

{code:java}
public interface ExceptionHandler {

public Object handleException(OperationContext operationContext, Exception e) throws Exception;
}
{code}

Then you can declare it at an Extension level:

{code:java}
@Extension
@Operations(Operations.class);
@OnException(handler = PetExceptionHandler.class)
public class PetStoreConnector {
…
}
{code}

Or at a configuration level:

{code:java}
@Configuration(name="pooled-config")
@PooledConnector(PetClientConnectionHandler.class)
@OnException(handler = PooledPetConnectionExceptionHandler.class)
public class PooledConnectionConfig {
}
{code}

A simple implementation would look similar to this:

{code:java}
public class PetExceptionHandler implements ExceptionHandler {

	public Object handleException(OperationContext operationContext, Exception e) throws Exception {
		if (irrelevantException(e)) {
			return operationContext.getConfigurationInstance().someDefaultValue();
		} else if (e instanceof SocketException) {
			throw new ConnectionException(e);
		} else {
			throw e;
}
}
}
{code}

