Add the concept of an ExceptionEnricher in the ext-api which gets invoked whenever an operation throws an exception. This is useful to avoid repetitive try..catch blocks.

It would be defined by an interface roughly looking like this

{code:java}
public interface ExceptionEnricher {

Exception enrichException(Exception e);
}
{code}

Then you can declare it at an Extension level:

{code:java}
@Extension
@Operations(Operations.class);
@OnException(handler = PetExceptionEnricher.class)
public class PetStoreConnector {
…
}
{code}

Or at a configuration level:

{code:java}
@Configuration(name="pooled-config")
@PooledConnector(PetClientConnectionHandler.class)
@OnException(handler = PooledPetConnectionExceptionEnricher.class)
public class PooledConnectionConfig {
}
{code}

A simple implementation would look similar to this:

{code:java}
public class PetExceptionEnricher implements ExceptionEnricher {

	public Exception enrichException(Exception e)  {
		if (irrelevantException(e)) {
			logger.error(e.getMessage())
		} else if (e instanceof SocketException) {
			return new ConnectionException(e); // wants to reconnect
		} else {
			return e;
                }
        }
}
{code}

Size validator has int parameters for min and max values but the generated XSD creates attributes with Long data type.

{code:xml}
 <xs:complexType name="ValidateSizeType">
    <xs:complexContent>
      <xs:extension xmlns:mule="http://www.mulesoft.org/schema/mule/core" base="mule:abstractMessageProcessorType">
        <xs:attribute type="mule:substitutableName" use="required" name="config-ref">
          <xs:annotation>
            <xs:documentation>Specify which configuration to use for this invocation.</xs:documentation>
          </xs:annotation>
        </xs:attribute>
        <xs:attribute type="mule:expressionObject" use="required" name="value"></xs:attribute>
        <xs:attribute type="mule:expressionLong" use="optional" name="min"></xs:attribute>
        <xs:attribute type="mule:expressionLong" use="optional" name="max"></xs:attribute>
        <xs:attribute type="mule:expressionString" use="optional" name="message"></xs:attribute>
        <xs:attribute type="mule:expressionString" use="optional" name="exceptionClass"></xs:attribute>
      </xs:extension>
    </xs:complexContent>
  </xs:complexType>
{code}

{code}
/**
     * Validates that {@code value} has a size between certain inclusive boundaries. This
     * validator is capable of handling instances of {@link String}, {@link Collection},
     * {@link Map} and arrays
     *
     * @param value   the value to validate
     * @param min     the minimum expected length (inclusive, defaults to zero)
     * @param max     the maximum expected length (inclusive). Leave unspecified or {@code null} to allow any max length
     * @param options the {@link ValidationOptions}
     * @param event   the current {@link MuleEvent
     */
    @Operation
    public void validateSize(Object value,
                             @Optional(defaultValue = "0") int min,
                             @Optional Integer max,
                             @ParameterGroup ValidationOptions options,
                             MuleEvent event) throws Exception
    {
        ValidationContext context = createContext(options, event);
        validateWith(new SizeValidator(value, min, max, context), context, event);
    }
{code}

