Currently, the @Extension annotation includes a version attribute which is used to specify an extension version.

However, it's undesirable to have the need to upgrade the version of every extension each time that a new version is released.

A mechanism should be defined for the extension version to be automatically inferred from the underlying ${project.version}

    @Rule
    public DynamicPort listenPort = new DynamicPort("port");

    public static final int HTTP_STATUS_VALUE_AUTHENTICATION = 200;
    public static final int HTTP_STATUS_VALUE_NOT_AUTHENTICATION = 401;
    public static final String HTTP_WWW_AUTHENTICATE_HEADER = "www-authenticate";
    public static final String HTTP_WWW_AUTHENTICATE_BASIC_HEADER_VALUE = "[Bb]asic realm=\"(.*)\"";

    @Override
    protected String getConfigFile()
    {
        return "http-listener-auth-config.xml";
    }

    @Test
    @Ignore 
    public void invalidBasicAuthentication() throws Exception
    {
        CredentialsProvider credsProvider = getCredentialsProvider("user","passwordInvalid");
        assertInvalidRequest("basic", listenPort.getNumber(), credsProvider, HTTP_WWW_AUTHENTICATE_BASIC_HEADER_VALUE);
    }

   private void assertInvalidRequest(String pathToCall, int serverPort, CredentialsProvider credsProvider, String wwwAuthenticateHeaderValue) throws Exception
    {
        final HttpResponse httpResponse = getHttpResponse(pathToCall, serverPort, credsProvider);

        assertThat(httpResponse.getStatusLine().getStatusCode(), equalTo(HTTP_STATUS_VALUE_NOT_AUTHENTICATION));

        String inboundPropertyHttpWWWAuthenticateHeader = httpResponse.getFirstHeader(HTTP_WWW_AUTHENTICATE_HEADER).getValue();
        assertTrue(inboundPropertyHttpWWWAuthenticateHeader.matches(wwwAuthenticateHeaderValue));
    }

    private void assertValidRequest(String pathToCall, int serverPort, CredentialsProvider credsProvider, String responseContentExpected) throws Exception
    {
        final HttpResponse httpResponse = getHttpResponse(pathToCall, serverPort, credsProvider);

        assertThat(httpResponse.getStatusLine().getStatusCode(), equalTo(HTTP_STATUS_VALUE_AUTHENTICATION));
        assertThat(IOUtils.toString(httpResponse.getEntity().getContent()), is(responseContentExpected));
    }

    private HttpResponse getHttpResponse(String pathToCall, int serverPort, CredentialsProvider credsProvider) throws IOException
    {
        CloseableHttpClient httpclient = HttpClients.custom().setDefaultCredentialsProvider(credsProvider).build();

        HttpPost httpPost = new HttpPost(String.format("http://localhost:%s/%s", serverPort, pathToCall));

        return httpclient.execute(httpPost);
    }

    private CredentialsProvider getCredentialsProvider(String user, String password)
    {
        CredentialsProvider credsProvider = new BasicCredentialsProvider();
        credsProvider.setCredentials(AuthScope.ANY, new UsernamePasswordCredentials(user, password));
        return credsProvider;
    }

