toString:
Replace the Builders with a fluent API at an ExtensionManager or Describer level. A mockup to take as reference (not commitment) of what we're shooting for is this:

{code:java}
    public Construct test()
    {
        return new DeclarationConstruct("ws-consumer", "1.0").describedAs("Web Service Consumer")
                .withConfig("config").declaredIn(String.class)
                .with().requiredParameter("wsdl-location").describedAs("uri to find the wsdl").ofType(String.class).whichIsNotDynamic()
                .with().requiredParameter("service").describedAs("serviceName").ofType(String.class)
                .withConfig("newConnector")
                .with().requiredParameter("wsdl-location").describedAs("uri to find the wsdl").ofType(String.class).whichIsDynamic()
                .with().requiredParameter("service").describedAs("serviceName").ofType(String.class)
                .with().optionalParameter("connector").describedAs("The connector to use").ofType(Object.class).defaultingTo(null)
                .withOperation("consume").describedAs("Go get them tiger!")
                .with().requiredParameter("operation").describedAs("the operation to execute").ofType(String.class)
                .with().optionalParameter("mtomEnabled").describedAs("Whether to use mtom or not").ofType(boolean.class);
    }
{code}

This should improve usability and reduce the complexity of our own code since now the builder implementation is part of the API

fromString:
While trying to debug an issue with Batch I set the log level to "DEBUG" and this prevented the application from working at all.

Attached you will find an application to reproduce it.

Simply import the app in Studio, run it and hit the endpoint http://localhost:9000/test

If you either remove the log4j.properties file or set the level to INFO it works fine. 

I checked the code and it's triggered from line 64 in org.mule.util.queue.DualRandomAccessFileQueueStoreDelegate:
{code}
        if (logger.isDebugEnabled())
        {
            logger.debug(String.format("Queue %s has %s messages", queueName, getSize()));
        }
{code}

toString:
While trying to debug an issue with Batch I set the log level to "DEBUG" and this prevented the application from working at all.

Attached you will find an application to reproduce it.

Simply import the app in Studio, run it and hit the endpoint http://localhost:9000/test

If you either remove the log4j.properties file or set the level to INFO it works fine. 

I checked the code and it's triggered from line 64 in org.mule.util.queue.DualRandomAccessFileQueueStoreDelegate:
{code}
        if (logger.isDebugEnabled())
        {
            logger.debug(String.format("Queue %s has %s messages", queueName, getSize()));
        }
{code}

This results into this when level = DEBUG:
{code}
java.lang.NullPointerException
	at org.mule.util.queue.DualRandomAccessFileQueueStoreDelegate.size(DualRandomAccessFileQueueStoreDelegate.java:143)
	at org.mule.util.queue.AbstractQueueStoreDelegate.getSize(AbstractQueueStoreDelegate.java:153)
	at org.mule.util.queue.DualRandomAccessFileQueueStoreDelegate.<init>(DualRandomAccessFileQueueStoreDelegate.java:66)
{code}

{code}
git co git@github.com:mulesoft/mule.git
cd mule
mvn -Punit -Dmule.test.timeoutSecs=30
{code}

This fails because unpacking embedded distribution dependencies is binded to generate-sources phase, but jars are still not available (because we are running test phase). Apparently Maven dependency plugin when jar is not available and has to resolve the dependency, resolves the artifact file as the classes directory for the dependency, so every file in that module is available to the current module. As we are trying to unpack it fails because the classes directory is not a jar file.

