This simple test reproduce that expiration policies don't work on the object store. 

<code>
ObjectStoreManager osManager = muleContext.getObjectStoreManager();
ObjectStore<Boolean> store = osManager.getObjectStore("RefreshTokenStore", false, 0, 5*1000, 5*1000);
final String TOKEN_LAUTARO = "lautaro";
store.store(TOKEN_LAUTARO, true);
Thread.sleep(6*1000);
store.contains("lautaro");
</code>

Expected behavior is that last line return false but returns true.

toString:
This simple test reproduce that expiration policies don't work on the object store. 

{code} 
final String TOKEN_LAUTARO = "lautaro";
ObjectStoreManager osManager = muleContext.getObjectStoreManager();
ObjectStore<Boolean> store = osManager.getObjectStore("RefreshTokenStore", false, 0, 5*1000, 5*1000);

store.store(TOKEN_LAUTARO, true);
Thread.sleep(6*1000);
store.contains(TOKEN_LAUTARO); //returns true, when it should be false
{code} 

Expected behavior is that last line return false but returns true.
